INSERT INTO `news` (`news_id`, `news_title`, `news_pub`, `news_updated`, `slug`, `news_content`, `admin_id`) VALUES
(18, 'USC Warriors Made It', '2015-11-22 08:45:11', '2015-11-22 08:45:11', 'usc-warriors-made-it', '<p>ERICKA ENTERPRISE<br />It is an open-source and royalty-free OSEK/VDX Kernel. This RTOS includes also RT-Druid, which is a development environment distributed as a set of Eclipse plugins.<br />Main Features:<br />? Hard Real-Time support with Fixed Priority Scheduling and Immediate Priority Ceiling;<br />? Support for Earliest Deadline First (EDF) and Resource Reservation Schedulers;<br />? 1-4 Kb Flash footprint, suitable for 8 to 32 bit microcontrollers;<br />? Support for multi-core platforms;<br />? Support for stack sharing among tasks;<br />? Easy configuration using RT-Druid with Eclipse plugins;<br />? Open-source: GPL2+Linking exception for the kernel, EPL for the Eclipse plugins.</p>', '09307896'),
(19, 'Warriors On Their Way', '2015-11-22 08:46:32', '2015-11-22 08:46:32', 'warriors-on-their-way', '<p><img class="post-img" src="/uscsportsportal/source/Fresh Camp Logo for White Shirt.png" alt="Fresh Camp Logo for White Shirt" width="1000" height="650"></p>\r\n<p>ERICKA ENTERPRISE<br />It is an open-source and royalty-free OSEK/VDX Kernel. This RTOS includes also RT-Druid, which is a development environment distributed as a set of Eclipse plugins.<br />Main Features:<br />? Hard Real-Time support with Fixed Priority Scheduling and Immediate Priority Ceiling;<br />? Support for Earliest Deadline First (EDF) and Resource Reservation Schedulers;<br />? 1-4 Kb Flash footprint, suitable for 8 to 32 bit microcontrollers;<br />? Support for multi-core platforms;<br />? Support for stack sharing among tasks;<br />? Easy configuration using RT-Druid with Eclipse plugins;<br />? Open-source: GPL2+Linking exception for the kernel, EPL for the Eclipse plugins.</p>', '09307896');
